import React, { Component } from "react";

class Submit extends Component {
  render() {
    return (
      <div class='container'>
        <a href='#' class='fa fa-facebook' id='socialMediaBtn'></a>
        <a href='#' class='fa fa-instagram' id='socialMediaBtn'></a>
        <a href='#' class='fa fa-youtube' id='socialMediaBtn'></a>
      </div>
    );
  }
}

export default Submit;
